webpackJsonp([83372189206993],{648:function(e,o){e.exports={pathContext:{docHtml:'<p><a href="https://argoproj.github.io/community/join-slack"><img src="https://img.shields.io/badge/slack-argoproj-brightgreen.svg?logo=slack" alt="slack"></a></p>\n<h1>Argoproj - Get stuff done with Kubernetes</h1>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/argo-a099ca3512e83579d67b0aa9ede5261a-1df76.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 458px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 49.12663755458516%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Argo Image"\n        title=""\n        src="/static/argo-a099ca3512e83579d67b0aa9ede5261a-1df76.png"\n        srcset="/static/argo-a099ca3512e83579d67b0aa9ede5261a-cd6d8.png 148w,\n/static/argo-a099ca3512e83579d67b0aa9ede5261a-56f1f.png 295w,\n/static/argo-a099ca3512e83579d67b0aa9ede5261a-1df76.png 458w"\n        sizes="(max-width: 458px) 100vw, 458px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>News</h2>\n<p>KubeCon 2018 in Seattle was the biggest KubeCon yet with 8000 developers attending. We connected with many existing and new Argoproj users and contributions, and gave away a lot of Argo T-shirts at our booth sponsored by Intuit!</p>\n<p>We were also super excited to see KubeCon presentations about Argo by Argo developers, users and partners.</p>\n<ul>\n<li>\n<p><a href="https://www.youtube.com/watch?v=OdzH82VpMwI&#x26;feature=youtu.be">CI/CD in Light Speed with K8s and Argo CD</a></p>\n<ul>\n<li>How Intuit uses Argo CD.</li>\n</ul>\n</li>\n<li>\n<p><a href="https://www.youtube.com/watch?v=ZK510prml8o&#x26;t=0s&#x26;index=169&#x26;list=PLj6h78yzYM2PZf9eA7bhWnIh_mK1vyOfU">Automating Research Workflows at BlackRock</a></p>\n<ul>\n<li>Why BlackRock created Argo Events and how they use it.</li>\n</ul>\n</li>\n<li>\n<p><a href="https://www.youtube.com/watch?v=VXrGp5er1ZE&#x26;t=0s&#x26;index=135&#x26;list=PLj6h78yzYM2PZf9eA7bhWnIh_mK1vyOfU">Machine Learning as Code</a></p>\n<ul>\n<li>How Kubeflow uses Argo Workflows as its core workflow engine and Argo CD to declaratively deploy ML pipelines and models.</li>\n</ul>\n</li>\n</ul>\n<p>If you actively use Argo in your organization and your organization would be interested in participating in the Argo Community, please ask a representative to contact saradhi_sreegiriraju@intuit.com for additional information.</p>\n<h2>What is Argoproj?</h2>\n<p>Argoproj is a collection of tools for getting work done with Kubernetes.</p>\n<ul>\n<li><a href="https://github.com/argoproj/argo">Argo Workflows</a> - Container-native Workflow Engine</li>\n<li><a href="https://github.com/argoproj/argo-cd">Argo CD</a> - Declarative GitOps Continuous Delivery</li>\n<li><a href="https://github.com/argoproj/argo-events">Argo Events</a> - Event-based Dependency Manager</li>\n</ul>\n<h2>What is Argo Workflows?</h2>\n<p>Argo Workflows is an open source container-native workflow engine for orchestrating parallel jobs on Kubernetes. Argo Workflows is implemented as a Kubernetes CRD (Custom Resource Definition).</p>\n<ul>\n<li>Define workflows where each step in the workflow is a container.</li>\n<li>Model multi-step workflows as a sequence of tasks or capture the dependencies between tasks using a graph (DAG).</li>\n<li>Easily run compute intensive jobs for machine learning or data processing in a fraction of the time using Argo Workflows on Kubernetes.</li>\n<li>Run CI/CD pipelines natively on Kubernetes without configuring complex software development products.</li>\n</ul>\n<h2>Why Argo Workflows?</h2>\n<ul>\n<li>Designed from the ground up for containers without the overhead and limitations of legacy VM and server-based environments.</li>\n<li>Cloud agnostic and can run on any Kubernetes cluster.</li>\n<li>Easily orchestrate highly parallel jobs on Kubernetes.</li>\n<li>Argo Workflows puts a cloud-scale supercomputer at your fingertips!</li>\n</ul>\n<h2>Documentation</h2>\n<ul>\n<li><a href="demo.html">Get started here</a></li>\n<li><a href="examples/README.html">How to write Argo Workflow specs</a></li>\n<li><a href="ARTIFACT_REPO.html">How to configure your artifact repository</a></li>\n</ul>\n<h2>Features</h2>\n<ul>\n<li>DAG or Steps based declaration of workflows</li>\n<li>Artifact support (S3, Artifactory, HTTP, Git, raw)</li>\n<li>Step level input &#x26; outputs (artifacts/parameters)</li>\n<li>Loops</li>\n<li>Parameterization</li>\n<li>Conditionals</li>\n<li>Timeouts (step &#x26; workflow level)</li>\n<li>Retry (step &#x26; workflow level)</li>\n<li>Resubmit (memoized)</li>\n<li>Suspend &#x26; Resume</li>\n<li>Cancellation</li>\n<li>K8s resource orchestration</li>\n<li>Exit Hooks (notifications, cleanup)</li>\n<li>Garbage collection of completed workflow</li>\n<li>Scheduling (affinity/tolerations/node selectors)</li>\n<li>Volumes (ephemeral/existing)</li>\n<li>Parallelism limits</li>\n<li>Daemoned steps</li>\n<li>DinD (docker-in-docker)</li>\n<li>Script steps</li>\n</ul>\n<h2>Who uses Argo?</h2>\n<p>As the Argo Community grows, we\'d like to keep track of our users. Please send a PR with your organization name.</p>\n<p>Currently <strong>officially</strong> using Argo:</p>\n<ol>\n<li><a href="https://admiralty.io/">Admiralty</a></li>\n<li><a href="https://www.adobe.com/">Adobe</a> </li>\n<li><a href="https://www.alibabacloud.com/about">Alibaba Cloud</a></li>\n<li><a href="https://www.blackrock.com/">BlackRock</a></li>\n<li><a href="https://www.canva.com/">Canva</a></li>\n<li><a href="https://www.corefiling.com/">CoreFiling</a></li>\n<li><a href="https://www.cratejoy.com/">Cratejoy</a></li>\n<li><a href="https://cyrusbio.com/">Cyrus Biotechnology</a></li>\n<li><a href="https://www.datadoghq.com/">Datadog</a></li>\n<li><a href="https://www.equinor.com/">Equinor</a></li>\n<li><a href="https://gardener.cloud/">Gardener</a></li>\n<li><a href="https://gladly.com/">Gladly</a></li>\n<li><a href="https://github.com/">GitHub</a></li>\n<li><a href="https://www.google.com/intl/en/about/our-company/">Google</a></li>\n<li><a href="https://www.interline.io/blog/scaling-openstreetmap-data-workflows/">Interline Technologies</a></li>\n<li><a href="https://www.intuit.com/">Intuit</a></li>\n<li><a href="https://www.kariusdx.com/">Karius</a></li>\n<li><a href="https://www.kintohub.com/">KintoHub</a></li>\n<li><a href="https://www.localytics.com/">Localytics</a></li>\n<li><a href="https://www.nvidia.com/">NVIDIA</a></li>\n<li><a href="https://www.preferred-networks.jp/en/">Preferred Networks</a></li>\n<li><a href="http://quantibio.com/us/en/">Quantibio</a></li>\n<li><a href="https://cx.sap.com/">SAP Hybris</a></li>\n<li><a href="https://www.styra.com/">Styra</a></li>\n</ol>\n<h2>Community Blogs and Presentations</h2>\n<ul>\n<li><a href="https://admiralty.io/blog/running-argo-workflows-across-multiple-kubernetes-clusters/">Running Argo Workflows Across Multiple Kubernetes Clusters</a></li>\n<li><a href="https://www.anaconda.com/blog/developer-blog/open-source-model-management-roundup-polyaxon-argo-and-seldon/">Open Source Model Management Roundup: Polyaxon, Argo, and Seldon</a></li>\n<li><a href="https://www.interline.io/blog/scaling-openstreetmap-data-workflows/">Producing 200 OpenStreetMap extracts in 35 minutes using a scalable data workflow</a></li>\n<li><a href="http://dev.matt.hillsdon.net/2018/03/24/argo-integration-review.html">Argo integration review</a></li>\n<li>TGI Kubernetes with Joe Beda: <a href="https://www.youtube.com/watch?v=M_rxPPLG8pU&#x26;start=859">Argo workflow system</a></li>\n<li><a href="https://docs.google.com/document/d/16aWGQ1Te5IRptFuAIFtg3rONRQqHC1Z3X9rdDHYhYfE">Community meeting minutes and recordings</a></li>\n</ul>\n<h2>Project Resources</h2>\n<ul>\n<li>Argo GitHub:  <a href="https://github.com/argoproj">https://github.com/argoproj</a></li>\n<li>Argo website: <a href="https://argoproj.github.io/">https://argoproj.github.io/</a></li>\n<li>Argo Slack:   <a href="https://join.slack.com/t/argoproj/shared_invite/enQtMzExODU3MzIyNjYzLTA5MTFjNjI0Nzg3NzNiMDZiNmRiODM4Y2M1NWQxOGYzMzZkNTc1YWVkYTZkNzdlNmYyZjMxNWI3NjY2MDc1MzI">click here to join</a></li>\n</ul>',docPath:"argo/readme",proj:"argo"}}}});
